import React from 'react'
import Slider from '../../Slider/Slider'

const Erase = (props) => {

    setSize = (size) => {
        props.Size(size);
    }

    return(
        <div>
            <Slider size = {this.setSize}>Size</Slider>
        </div>
        );
    };


export default Erase;
